import 'package:ieca_mobile/_import.dart';

class NgHymnsKuIzaKuaMuangana {
  static List<HymnsContent> list =[
    HymnsContent(id: 3424, position: 1, content: "Lelo iza na maselua,\nYesu, vantu va Mu tsiha;\nNa mbunga ya yingi,\nVakua-vusunga va Mu kava;\nHaleluya, Yesu, iza na ku suana.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_51, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3425, position: 2, content: "Vose va ka Mu monako,\nA va lingisa liova;\nVa-Mu-tsiha va ka zaza,\nKa va Mu hianga va vindama;\nNa ku lila va ka mona Mesiya.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_51, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3426, position: 3, content: "Lilu na mavu na kalunga,\nVi zimbala na vantu;\nKuze ku ka sala lika,\nVa na luile na Kilistu;\nNji tatela, ka ize vuasi, Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_51, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3427, position: 1, content: "A ci keza ha maselua,\nYesu, Ua tsila vipi;\nZimbunga zia vana Veni,\nVa sangala Ikeye;\nHaleluya, Haleluya\nNjambi tuaya U suane", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_52, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3428, position: 2, content: "Vantu vose va ka mona,\nA zala ngue Muangana;\nVose va na Mu yengula,\nVa Mu tsiha ku muti,\nVa ka lila, va ka lila,\nVa ka mona Mesiya.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_52, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3429, position: 3, content: "Eua, ame, tu lemesa\nYove, Yesu Kilistu,\nTambula vuangana Vuove,\nSuana ku miaka Yose;\nTuaya vuasi; tuaya vuasi,\nHaleluya, tuayanie.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_52, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3430, position: 1, content: "A ka iza, A ka iza,\nKu tambula Vendi;\nVa-ku-tava, va-ku-jela,\nVantu va Yesu.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3431, content: "Tu ka kala hamo Nendi,\nNa muvila ngue Uendi,\nTu ka suana na ku viazima\nOmo A kesa.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_53, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3432, position: 2, content: "A hindula, A hindula\nVaze va ci kala;\nA sangula, A sangula,\nVaze va na tsi.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3433, position: 3, content: "A ka hana, A ka hana\nKu-fueta kua kama;\nKuli ava, nava lika,\nVa Mu pangela.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_53, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3434, position: 4, content: "Tu ka kala, tu ka kala\nNa vumpahu lika;\nVivi viahi, na ku-tsa kuahi,\nMiaka na miaka.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_53, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3435, position: 1, content: "Njambi Tata A ka sana\nKaha ntsimbu i ka hua,\nNa cimenemene muilu ci ka ca;\nVantu vose va novoka\nVa ka kungulukako,\nVa ka sana mazina etu muilu.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_54, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3436, content: "Va ka sana vakua-Yesu,\nVa ka sana vakua-Yesu,\nVa ka sana vakua-Yesu,\nNange naua Njambi A ka nji sana.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_54, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3437, position: 2, content: "Ku cimenemene cize\nOmo tu ka sanguka,\nNa vumpahu vua Yesu tu ka zala;\nVose vakua-Yesu va ka kala\nKu ndzivo Yendi,\nVa ka sana mazina etu muilu.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_54, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3438, position: 3, content: "Yesu tu Mu pangelienu\nLitangua lietu liose,\nTu zimbulienu ngozi kuli vantu;\nKaha omo muono\nNa vipange viose vi na hu,\nVa ka sana mazina etu muilu.", hymnsNumber: NgHymnsNumberSeeder.KU_IZA_KUA_MUANGANA_54, typeStanza: HymnsContentCode.VERSE),
  ];
}